import logo from './logo.svg';
import './App.css';
import SideBarComponent from './SideBarComponent.js';
import axios from 'axios';
import { useEffect, useState } from 'react';

function App() {

  const [response, setResponse] = useState([])

  useEffect(()=> {
    axios.get('https://web-yelp-project.wl.r.appspot.com/business_results?term=sushi%20bars&latitude=33.8491816&longitude=-118.3884078&categories=all&radius=10')
      .then((res)=> {
        setResponse(res.data);
      });
  });
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        {
        response.businesses.map((business)=><SideBarComponent cohortResult={business}/>)
        }
      </header>
    </div>
  );
}

export default App;
